  const handleClick = () => {
    setIsClicked(!isClicked);
  };

  return (
    <nav>
      <div className="container">
        <Logo />

        <div className="menu">
          <a href="#">Info Channel</a>
          <a href="#">Participants</a>
        </div>

        <button
          className={isClicked ? "hamburger is-active" : "hamburger"}
          onClick={handleClick}
        >
          <span></span>
          <span></span>
          <span></span>
        </button>
      </div>
    </nav>
  );
}

